	public static String getElementName(String line){
		Matcher m = Pattern.compile("\"(.{0,}?)\"").matcher(line);
		int findIndex = 0;
		while(m.find()){
			if(++findIndex==2){
				return m.group(1);
			}
		}
		return "";
	}
	
